import React from 'react';

const Postitem = (props) => {
    console.log(props)
    return (
        <div className="post">
            <div className="post__content">
                <strong> {props.posts.id} {props.posts.title}</strong>
                <div>
                    {props.posts.body}
                </div>
            </div>
            <div className="post__btns">
                <button>Видалити</button>
            </div>
        </div>
    )
}

export default Postitem;
